import { Image, StyleSheet, Text, View } from "react-native";
import React from "react";

const Home = (props) => {
  return (
    <View style={styles.mainContainer}>
      <View style={styles.Container}>
        <Image
          style={styles.img}
          source={{
            uri: "https://media.wired.com/photos/5cdef92d38916b321aa0c474/master/w_2560%2Cc_limit/Facebook-Robots-00.jpg",
          }}
        />
        <View style={styles.headingContainer}>
          <Text style={styles.headingOne}>WELCOME TO </Text>
          <Text style={styles.headingTwo}> TOP-G ROBOLAB </Text>
        </View>
        <Text style={styles.text}>"Welcome to our YouTube channel, where we embark on thrilling adventures, share inspiring stories, and dive into the fascinating world of exploration!"</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  mainContainer: {
    display: "flex",
    alignItems: "center",
     height:'100%',
    // backgroundColor: "yellow",
    width: "100%",
  },
  Container: {
    margin: 20,
    // backgroundColor: "pink",
    width: "80%",
    height: "80%",
    display: "flex",
    alignItems: "center",
  },
  img: {
    width: "100%",
    height: "50%",
  },
  headingContainer: {
    fontWeight: "700",
    fontSize: 20,
    // backgroundColor: "coral",
    height: "15%",
    width: "100%",
    alignItems:'center',
    marginTop:22
  },

  headingOne: {
    fontWeight: "700",
    fontFamily: "bold",
    fontSize: 20,
  },
  headingTwo: {
    fontWeight: "800",
    fontFamily: "bold",
    fontSize: 25,
    marginTop:3,

  },
  text: {
    
  },
});
export default Home;
